import React from 'react'
import App from './App'
import Login from './Pages/Login'
import Transactions from './Pages/Transactions'

const routes = [
      {
        path:"/",
        element: <App />
      }, 
      {
        path:'/login',
        element: <Login />
      }
      , 
      {
        path:'/transactions',
        element: <Transactions />
      }
    ]

export default routes
